import "./Contact.css";

//const API = process.env.REACT_APP_API_URL;
const API = "https://backend-9i6n.onrender.com";

const Contact = () => {
  const [members, setMembers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
